def genGEffe(result, L1, L2, L3):
    for i in range(0, len(L3)):
         result.append((L3[i]*L1[i]) ^ ((1 ^ L3[i])*(L2[i])))
    return result

def XorArrays(array1, array2):
    result = list(a^b for a,b in zip(array1, array2))
    return result

def generateBit1(x0, x3):
    newBit = XOR(x0, x3)
    return newBit

def generateBit2(y0, y1, y2, y6):
    newBit = XOR(XOR(XOR(y0, y1), y2), y6)
    return newBit

def generateBit3(s0, s1, s2, s5):
    newBit = XOR(XOR(XOR(s0, s1), s2), s5)
    return newBit

